import React from 'react'
import Field from './Field'
import './Fielddetails.css'
import Member from './Member'
import {useState,useEffect} from 'react'


function Fielddetails() {

    const [data, setData] = useState([]); 

    useEffect(() => {
        const sendingPost = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },

            body: '{"query": "{categoryByName{name,stackImage}}"}'
        };

         fetch('http://127.0.0.1:8000/graphql', sendingPost)
            .then(response => response.json())
            .then(data => setData(data.data.allCategories));
    },[])

    console.log(data);

    let fieldboard = []
    for(let row=0;row<data.length;row++){
        fieldboard[row]=
        <Field
        stack_image='https://p1.hiclipart.com/preview/697/161/312/button-ui-app-one-green-android-icon-png-clipart.jpg'
        name={data[row]['name']}
        />
    }

    return (

        <div className='category'>
            {fieldboard}
        </div>
    )
}

export default Fielddetails




